package ticket_parser

import (
	"encoding/base64"
	"testing"

	"github.com/stretchr/testify/assert"
	"github.com/stretchr/testify/require"
)

func TestParseV1(t *testing.T) {
	_, err := ParseV1("2:wtf")
	require.Error(t, err)

	_, err = ParseV1("1:+a/sds")
	require.Error(t, err)

	keys, err := ParseV1(pubKeys)
	require.NoError(t, err)
	assert.Len(t, keys, 14)
}

func TestParseServiceTicket_Basic(t *testing.T) {
	testStr := `3:serv:CBAQ__________9_IhcIDBAcGgdiYjpzZXNzGghiYjpzZXNzMg:OKjKEbygehEZWH0XEeLzvf0q0aS0VvSk_CKSXGdpqxPbE4RzU70jeM-X9rXVpbYjt76VgBLlBpumJdyiclulfGPDPiL8nwJuu8AnWIR_o-QqyXbsloo2_syE6w2aYw2Yw_5_qjnipYdxGUWegHAGCj3yeMde6O2BmNZ0OCfg6qU`
	ticket, err := ParseServiceTicket(testStr)
	require.NoError(t, err)
	assert.Equal(t, "3:serv:CBAQ__________9_IhcIDBAcGgdiYjpzZXNzGghiYjpzZXNzMg:", string(ticket.ForCheck))
	assert.Equal(t, decodeBase64("OKjKEbygehEZWH0XEeLzvf0q0aS0VvSk_CKSXGdpqxPbE4RzU70jeM-X9rXVpbYjt76VgBLlBpumJdyiclulfGPDPiL8nwJuu8AnWIR_o-QqyXbsloo2_syE6w2aYw2Yw_5_qjnipYdxGUWegHAGCj3yeMde6O2BmNZ0OCfg6qU"), ticket.Sign)
	require.NoError(t, err)
	assert.Equal(t, uint32(16), ticket.KeyID)
	assert.Equal(t, uint32(12), ticket.SrcClientId)
	assert.Equal(t, uint32(28), ticket.DstClientId)
}

func TestParseServiceTicket_WrongType(t *testing.T) {
	testStr := `3:usr:somedata:stuff`
	_, err := ParseServiceTicket(testStr)
	require.Error(t, err)
	require.Contains(t, err.Error(), "wrong ticket type")
}

func TestParseServiceTicket_NoSign(t *testing.T) {
	testStr := `3:serv:CBAQ__________9_IhcIDBAcGgdiYjpzZXNzGghiYjpzZXNzMg:`
	_, err := ParseServiceTicket(testStr)
	require.Error(t, err)
	require.Contains(t, err.Error(), "no signature")
}

func decodeBase64(in string) []byte {
	if v, err := base64.RawURLEncoding.DecodeString(in); err == nil {
		return v
	}
	return nil
}

